/**
 * Errors returned by the World App
 */

public enum AppError: Equatable, Hashable {
    
    /**
     * User rejected the request
     */
    case userRejected
    /**
     * Verification rejected
     * Legacy error, it's replaced by `UserRejected` in the new Bridge Protocol
     */
    case verificationRejected
    /**
     * Credential unavailable
     */
    case credentialUnavailable
    /**
     * Malformed request
     */
    case malformedRequest
    /**
     * Invalid network
     */
    case invalidNetwork
    /**
     * Inclusion proof pending
     */
    case inclusionProofPending
    /**
     * Inclusion proof failed
     */
    case inclusionProofFailed
    /**
     * Unexpected response
     */
    case unexpectedResponse
    /**
     * Connection failed
     */
    case connectionFailed
    /**
     * Maximum verifications reached
     */
    case maxVerificationsReached
    /**
     * Verification failed by host app
     */
    case failedByHostApp
    /**
     * Generic error
     */
    case genericError



}

